import './index.scss';
import Header from './components/Header';
import Home from './pages/Home';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div class="container">
        <Header />
        <Home />
      </div>
    </BrowserRouter>
  );
}

export default App;
